create database GlassBreaker;

use GlassBreaker;

##industry table and insert statements
create table industry(
    industryID int auto_increment primary key,
    name text
);


##userType table and insert statements

create table userType(
    userTypeID int auto_increment primary key,
    name text
);

values (1, 'admin'), (2, 'HR manager'), (3, 'employee');

##jobType table and insert statements

create table jobType(
    jobTypeID int auto_increment primary key,
    name text
);


##user table and insert statements

create table user(
    userID int auto_increment primary key,
    userTypeID int,
    firstName text,
    lastName text,
    email text,
    username text,
    password text,
    active boolean,
    constraint fk_userTypeID
        foreign key (userTypeID) references userType (userTypeID)
        on update cascade on delete restrict
);


# START OF INACTIVE USERS
# END OF INACTIVE USERS


#company table and insert statements

create table company(
    companyID int auto_increment primary key,
    name text,
    country text,
    state text,
    zip int,
    streetName text,
    streetNum int
);


##industryCompany table and insert statements

create table industryCompany(
    companyID int,
    industryID int,
    constraint pk_industryCompany primary key (industryID, companyID),
    constraint fk_companyID_ind_comp
        foreign key (companyID) references company (companyID)
        on update cascade on delete restrict,
    constraint fk_industryID
        foreign key (industryID) references industry (industryID)
        on update cascade on delete restrict
);



##department table and insert statements

create table department
(
    deptID    int auto_increment,
    companyID int,
    name      text,
    managerID int,
    constraint pk_department primary key (deptId, companyID),
    constraint fk_companyID
        foreign key (companyID) references company (companyID)
            on update cascade on delete restrict
);


#division table and insert statements

create table division
(
    divID     int auto_increment,
    deptID    int,
    companyID int,
    name      text,
    managerID int,
    constraint pk_division primary key (divID, deptId, companyID),
    constraint fk_deptID
        foreign key (deptID) references department (deptID),
    constraint fk_companyID_div
        foreign key (companyID) references department (companyID)
);





















#jobPosition table and insert statements

create table jobPosition(
    positionID int auto_increment primary key,
    name text,
    divID int,
    deptID int,
    companyID int,
    jobTypeID int,
    availability boolean,
    reported boolean,
    description text,
    constraint fk_divID_job_pos
        foreign key (divID) references division (divID)
        on update cascade on delete restrict,
    constraint fk_deptID_job_pos
        foreign key (deptID) references division (deptID)
        on update cascade on delete restrict,
    constraint fk_companyID_job_pos
        foreign key (companyID) references division (companyID)
        on update cascade on delete restrict,
    constraint fk_jobTypeID
        foreign key (jobTypeID) references jobType (jobTypeID)
        on update cascade on delete restrict
);

select * from jobPosition;

#employee table and insert statements

create table employee(
    employeeID int auto_increment primary key,
    userID int,
    firstName text,
    lastName text,
    country text,
    state text,
    zip int,
    streetName text,
    streetNum int,
    email text,
    phone text,
    reportsTo int,
    hireDate datetime default current_timestamp,
    salary int,
    divID int,
    deptID int,
    companyID int,
    positionID int,
    birthDay int,
    birthMonth int,
    birthYear int,
    constraint fk_divID
        foreign key (divID) references division (divID)
        on update cascade on delete restrict,
    constraint fk_reportsTo
        foreign key (reportsTo) references employee (employeeID)
        on update cascade on delete restrict,
    constraint fk_deptID_emp
        foreign key (deptID) references division (deptID)
        on update cascade on delete restrict,
    constraint fk_companyID_emp
        foreign key (companyID) references division (companyID)
        on update cascade on delete restrict,
    constraint fk_userID
        foreign key (userID) references user (userID)
        on update cascade on delete restrict,
    constraint fk_job_position_empID
        foreign key (positionID) references jobPosition (positionID)
        on update cascade on delete restrict
);

